import React from 'react';

import Header from './header.js';
import Body from './body.js';
import './index.css';
import ReactDOM from 'react-dom';


function App() {
  return (
    <div className="wrapper">
      <Header />
      <Body />
    </div>
  );
}

export default App;

class Index extends React.Component {
  render() {
    return (
      App()
    );
  }
}

// ========================================

ReactDOM.render(
  <Index />,
  document.getElementById('root')
);
